// Store the JWT token in the local storage
localStorage.setItem('jwtToken', jwtToken);
const token = "Bearer " + localStorage.getItem("jwtToken");

const headers = {
  "Content-Type": "application/json",
  Authorization: token,
  "X-API-KEY": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJjbGFpbXMiOm51bGwsImlzcyI6InBoZWV0LXNob3AtYXBpIiwic3ViIjoiYXBpLWtleSIsImF1ZCI6WyJhZG1pbiIsImN1c3RvbWVyIl0sImV4cCI6MTc2MjI0Njc5MiwibmJmIjoxNjk5MDg4MzkyLCJpYXQiOjE2OTkwODgzOTJ9.H-3l1Jysdkg6oUQiErLOjF2RyNahUVvQqwE2lesvhlM"
};

const fetchAllProduct = async () => {
    try {
        const queryParams = {
            page: 1,
            per_page: 5,
        };
        const resp = await axios.get(url,
            {
                headers,
                params: queryParams
            });
        console.log(resp.data);
    }
    catch (err) {
        console.error(err)
    }
}

function Product() {
  return (
      <div className="product-body">
        Product Page
        <div>
            <button className="button-fetch" type="button" onClick={fetchAllProduct}>get data</button>
        </div>
      </div>

  );
}

export default Product;
